import React, { Component } from 'react';
import Card from './Card';

const CardList = ({robots})=>{
    const cardComp = ()=>{
        var arr = [];
        for(var i=0; i<10; i++){
            arr.push(<Card key={i} id={robots[i].id} name={robots[i].name} email={robots[i].email} />);
        }
        return arr;
    }
    return(
        <div>
            {cardComp()}
        </div>
    );
}

export default CardList;
